import React from 'react';
import { LineAnimation } from './components/animations/shapes';
import Navbar from './components/navigation';
import './App.css';
import './components/styles/home.css';


function App() {
  return (
    <div className="App">

      {/**Font for Georgia Tech link */}
      <style>
        @import url('https://fonts.googleapis.com/css2?family=IBM+Plex+Mono:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;1,100;1,200;1,300;1,400;1,500;1,600;1,700&display=swap');
        @import url('https://fonts.googleapis.com/css2?family=Roboto+Slab:wght@100..900&display=swap')
      </style>

      <header className="home_page_ui">
        <div className='home_text_container'>
          <p class="header-introduction"> I'm Nelson Rodriguez </p>
          <p class='header-information'>A Developer {/**<a class="company">@Meta</a>**/} and
            <a> </a>
            <a class="link-parchment" target="_blank" rel="noopener noreferrer" href="https://www.parchment.com/u/award/cdc63a097762a059103a9b3ce857a15e">CS Alum</a>
            <a> </a>
            <a class="link-gatech" target="_blank" rel="noopener noreferrer" href="https://www.cc.gatech.edu/">
              <strong class="georgia-tech">@Georgia Tech</strong>
            </a> 
          </p>
        </div>
        <Navbar/>
      </header>
      {/**
       * Body section for animations
       */}
      <body>
        {/** <SvgAnimation/>*/}
        {/** take out svg animation it is not necessary */}
      </body>
    </div> 
  );
};

export default App;
